import React, { useState, useEffect } from "react";
import axios from "axios";
import { useLocation } from 'react-router-dom';
import './home.css'
function Home() {
    const location = useLocation();
    const [userData, setUserData] = useState(null);
    const [error, setError] = useState(null);

    useEffect(() => {
        async function fetchUserData() {
            try {
                const response = await axios.get(`http://localhost:8000/user/${location.state.id}`);
                setUserData(response.data);
            } catch (error) {
                console.error("Error fetching user data:", error);
                setError(error.message); // Set the error message
            }
        }

        fetchUserData();
    }, [location.state.id]);

    return (
        <div>
            <h2>Welcome to the Home Page</h2>
            {error ? (
                <p>Error: {error}</p>
            ) : (
                userData ? (
                    <div className="container">
                        <div className="box">
                            <div className="topbar">
                                <div className="left">Connected Devices: <br />
                                    <span>{userData.connectedDevices}</span>
                                </div>
                                <div className="center">Network Device Name: <br />
                                    <span>{userData.networkDevicesname}</span>
                                </div>
                                <div className="right">
                                    <span>{userData.username}</span>
                                </div>
                            </div>
                            <div className="div1">
                                <div>
                                    <p><i className="fa-solid fa-wallet" style={{ color: "orange" }}></i> Current Balance: <span>{userData.currentbalance}</span></p>
                                    <p><i className="fa-solid fa-coins" style={{ color: "orange" }}></i> Amount Due: Ksh <span>{userData.Amount}</span></p>
                                </div>
                                <div>
                                    <p><i className="fa-solid fa-check fa-lg" style={{ color: "#2fb90c" }} ></i> Payment Status: <span>{userData.paymentStatus}</span></p>
                                </div>
                            </div>
                            <div className="div2">
                                <p>Current Package</p>
                                <div className="net">
                                    <div>
                                        <p className="span"><span>{userData.networkSpeed}</span></p>
                                        <p>Network Speed</p>
                                    </div>
                                    <div className="line"></div>
                                    <div>
                                        <p className="span"><span id="remainingDays">{userData.remainingDay}</span> Days</p>
                                        <p id="expiryDate">Expires on: <span id="expiryDateValue">{userData.subscriptionStartDate}</span></p>
                                    </div>
                                </div>
                            </div>
                            <div className="div3">
                                <div>
                                    <p><i className="fa-solid fa-signal" style={{ color: "#dcedf9" }}></i> Signal Strength </p>
                                    <p className="dbm">{userData.signalStrength}</p>
                                </div>
                            </div>
                            <div className="net">
                                <a href="https://wa.me/+254772809396" target="_blank" rel="noopener noreferrer">Chat with us on WhatsApp</a>
                                <a href="/" className="button">Log out</a>
                            </div>
                        </div>
                    </div>
                ) : (
                    <p>Loading...</p>
                )
            )}
        </div>
    );
}

export default Home;
